import React from 'react';
import './nav.css'

class NavBar extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
          class: 'big'
      };
        this.displayMenu = this.displayMenu.bind(this);
        this.hideMenu = this.hideMenu.bind(this);
      }

    displayMenu() {
        this.setState({
            class: 'small'
        })
    }

    hideMenu() {
        this.setState({
            class: 'big'
        })
    }
    render(){
        return (
            <div className='navbar'>
                <h1 >Sol</h1>
                <button onMouseEnter= {this.displayMenu} >Burger</button>
                <ul className = {this.state.class} >
                    <li >Cool graph I can do with API data</li>
                    <li >Test to email app</li>
                    <li >Park app</li>
                    <li>Awesome game about true love</li>
                </ul>
            </div>
        )
    }
}

export default NavBar;
